import React from "react";
import { useSelector, useDispatch } from "react-redux";
import { boxesActions } from "../store/boxCheck";

const Circle = () => {
    const dispatch = useDispatch();
  const currentEnabledIndex = useSelector(
    (state) => state.boxes.currentEnabledIndex
  );
  const circleStates = useSelector((state) => state.boxes.circleStates);
  console.log("hello this is a test");
  console.log(circleStates);

  let correctRightPlace = Array.apply(
    null,
    Array(parseInt(circleStates[currentEnabledIndex].correctRightPlace + ""))
  ).map(Number.prototype.valueOf, 0);
  let correctWrongPlace = Array.apply(
    null,
    Array(parseInt(circleStates[currentEnabledIndex].correctWrongPlace + ""))
  ).map(Number.prototype.valueOf, 0);

  let uncorrect = Array.apply(
    null,
    Array(parseInt(circleStates[currentEnabledIndex].uncorrect + ""))
  ).map(Number.prototype.valueOf, 0);
};

export default Circle;
